import React from 'react'

function ReferenceComponent(props) {
  return (
    <figure className="reference-box">
    <figcaption><p>Děkujeme za veškerý čas a práci s návrhy pro nás. Jsme rádi, že jsme nezůstali jen u dispozic, ale viděli jsme i 3D návrhy, které nám více pomohly k rozhodnutí…. manželé z Liberce</p></figcaption>
    <img loading="lazy" src={props.image} />
</figure>
  )
}

export default ReferenceComponent
